    /**
     * @throws \think\db\exception\DataNotFoundException
     * @throws \think\db\exception\ModelNotFoundException
     * @throws \think\exception\DbException
     * 房间详情
     */
    public function room_info()
    {
        $building_id = \input('build_id', 1);
        $room_id = \input('room_id', 101);
        $map = [
            'building_id' => $building_id,
            'room_number' => $room_id
        ];
        $data = Db::name('ParkRoom')
            ->where($map)
//            ->field('building_id,floor,room_number,area,enterprise_id')
            ->find();
        if (!empty($data)) {
            $data['building_id'] = \getBuildNameByBuildId($data['building_id']);
            $data['enterprise_id'] = \getEnterpriseNameByEnterpriseId($data['enterprise_id']);
            $this->success('OK', $data);
        } else {
            $this->error('请求不存在的数据');
        }
    }
